const HARVESTING_CAP = 0.35;

const calcAccountHarvestPower = ({
  envClaimPower,
  accountPlantPower,
  growthModifier,
  growthProgress,
  totalHarvestingPowerBonus,
}) => {
  const harvestPower =
    envClaimPower *
    accountPlantPower *
    totalHarvestingPowerBonus *
    growthProgress *
    growthModifier;
  return harvestPower > HARVESTING_CAP ? HARVESTING_CAP : harvestPower;
};
module.exports = calcAccountHarvestPower;
